using System;
using System.Collections.Generic;

namespace TranslatingRNAToProtein
{
    class Program
    {
        static void Main(string[] args)
        {
            RnaToProtein("");
        }

        private static void RnaToProtein(string s)
        {
            string protein = "";
            Dictionary<string, char> rnaCodonTable = CreateDictionary();
            for (int rna = 0; rna < s.Length - 2; rna += 3)
            {
                string rnaStrand = s.Substring(rna, 3);
                if (rnaCodonTable.ContainsKey(rnaStrand))
                    protein += rnaCodonTable[rnaStrand];
                else
                    break;
            }
            Console.WriteLine(protein);
        }

